const layoutStyle = {
  backgroundColor: 'red',
    border: 'none',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
    textDecoration: 'none',
    display: 'inline-block',
    fontSize: '16px',
    margin: '4px 2px',
    borderRadius: '50%',
    display:'inline-block'
};

const Layout = props => (
  <div>
    <button style={layoutStyle}>Previous</button>
  </div>
);

export default Layout;
